+  public int[] numMovesStones(int a, int b, int c) {
+    final List<Integer> list = Arrays.asList(a, b, c);
+    Collections.sort(list);
+    a = list.get(0);
+    b = list.get(1);
+    c = list.get(2);
+    if (a + 1 == b && b + 1 == c) {
+      return new int[]{0, 0};
+    }
+    return new int[]{a + 1 == b || b + 1 == c || a + 2 == b || b + 2 == c ? 1 : 2, c - a - 2};
